import React from "react";
import styled from "styled-components";

const Feature = () => {
  return (
    <>
      <Main>
        <TextGroup>
          <Heading>Move faster by organizing your work life</Heading>
          <Paragraph>
            The key to productivity in Slack is organized spaces called
            channels—a different one for everything you’re working on. With all
            the people, messages and files related to a topic in one place, you
            can move a whole lot faster.
          </Paragraph>
          <Link>Learn more about channels</Link>
        </TextGroup>
        <Video>
          <video
            src="./videos/Slack is where the future works.mp4"
            autoPlay
            loop
            muted
          ></video>
        </Video>
      </Main>
    </>
  );
};

export default Feature;

const Main = styled.div`
  display: gri;
  align-items: center;
`;
const TextGroup = styled.div`
  margin-top: 0px;
`;
const Heading = styled.h2`
  font-size: 32px;
`;
const Paragraph = styled.p`
  font-size: 20px;
  margin-top: 15px;
  margin-bottom: 15px;
`;
const Link = styled.a`
  font-size: 18px;
  color: #1264a3;
`;
const Video = styled.div`
  margin-top: 120px;
`;
